import React, {Component} from 'react';
import axios from 'axios';
import Carousel from '../../components/Carousel/Carousel';
import './HomePage.css';

class HomePage extends Component{

    render(){
        return(
            <div className="app">
                <Carousel data={this.state.cards}/>
            </div>
        );
    }
}
export default HomePage;
